pub enum SignAndDispatchError {

    /// Error was due to bad credentials
    Credentials(CredentialsError),

    /// Error was due to http dispatch
    Dispatch(HttpDispatchError),
}

pub enum RusotoError<E> {

    /// A service-specific error occurred.
    Service(E),

    /// An error occurred dispatching the HTTP request
    HttpDispatch(HttpDispatchError),

    /// An error was encountered with AWS credentials.
    Credentials(CredentialsError),

    /// A validation error occurred.  Details from AWS are provided.
    Validation(String),

    /// An error occurred parsing the response payload.
    ParseError(String),

    /// An unknown error occurred.  The raw HTTP response is provided.
    Unknown(BufferedHttpResponse),

    /// An error occurred when attempting to run a future as blocking
    Blocking,
}

pub enum ContentEncoding {

    /// Indicates the identity function (i.e., no compression or modification)
    Identity,
}
